import React from 'react'
import {Link} from 'react-router-dom'

function Navbar() {
  return (
    <div className='navbar'>
        <Link to="/" className="menu-bar">
                  <i className="fas fa-home"></i> Home
        </Link>
    </div>
  )
}

export default Navbar
